sys_variable_value.value:
(function (inputs, outputs) {
  function hasValue(v) {
    return !(v === undefined || v === null || v === '');
  }

  function coerceObject(parsed, stringified) {
    if (hasValue(parsed)) return parsed;
    if (hasValue(stringified)) {
      try {
        return JSON.parse(stringified);
      } catch (e) {
        throw new Error('objectStringified is not valid JSON');
      }
    }
    throw new Error('Provide either objectParsed or objectStringified');
  }

  function normalizePath(path) {
    if (!hasValue(path)) return '';
    var p = String(path);
    p = p.replace(/\[(\d+)\]/g, '.$1');
    p = p.replace(/\[['"]([^'"]+)['"]\]/g, '.$1');
    return p.split('.').filter(function (seg) { return seg !== ''; });
  }

  function getByPath(obj, path) {
    if (!hasValue(path)) return obj;
    var keys = normalizePath(path);
    var cur = obj;
    for (var i = 0; i < keys.length; i++) {
      if (cur === undefined || cur === null) return undefined;
      var k = keys[i];
      if (Array.isArray(cur) && /^[0-9]+$/.test(k)) {
        cur = cur[parseInt(k, 10)];
      } else {
        cur = cur[k];
      }
    }
    return cur;
  }

  var source = coerceObject(inputs.objectParsed, inputs.objectStringified);
  var value = getByPath(source, inputs.objectProperty);

  outputs.objectvaluejson = (value === undefined) ? null : value;
  if (value === undefined) {
    outputs.objectvaluestring = '';
  } else if (typeof value === 'object') {
    try {
      outputs.objectvaluestring = JSON.stringify(value);
    } catch (e) {
      outputs.objectvaluestring = '';
    }
  } else {
    outputs.objectvaluestring = String(value);
  }
})(inputs, outputs);

